  <script src="https://unpkg.com/@panzoom/panzoom@4.5.1/dist/panzoom.min.js"></script>
  <script>
    const elem = document.querySelector(".content-svg");
    const btnZoomIn = document.querySelector(".zoom-in");
    const btnZoomOut = document.querySelector(".zoom-out");
    const panzoom = Panzoom(elem, { contain: "outside", startScale: 1 });
    panzoom.pan(10, 10);
    panzoom.zoom(1, { animate: true });

    // Panning and pinch zooming are bound automatically (unless disablePan is true).
    // There are several available methods for zooming
    // that can be bound on button clicks or mousewheel.
    btnZoomIn.addEventListener("click", panzoom.zoomIn);
    btnZoomOut.addEventListener("click", panzoom.zoomOut);
    // elem.parentElement.addEventListener("wheel", panzoom.zoomWithWheel);
